const unknown: CountryType = Object.freeze({
    name: "Unknown",
    flag:
        "",
})

export type CountryType = {
    name: string
    flag: string // base64
}

export const resolveCountry = (countryCode?: string): CountryType => {
    if (!countryCode) {
        return unknown
    }
    return (
        countries[countryCode.toLowerCase()] || {
            ...unknown,
            countryCode,
        }
    )
}
